## Examples The following code example uses the `TableProperties` class to create a Table and specify its border information.
```csharp using System; using DocumentFormat.OpenXml; using DocumentFormat.OpenXml.Packaging; using DocumentFormat.OpenXml.Wordprocessing;
namespace TablePropertiesEx { class Program { // Insert a table into an existing word processing document. static void Main(string[] args) { string fileName = @"C:\users\public\documents\TablePropertiesEx.docx"; using (WordprocessingDocument document = WordprocessingDocument.Open(fileName, true)) { // Create an empty table. Table table = new Table();
// Create a TableProperties object and specify its border information. TableProperties tableProperties = new TableProperties( new TableBorders(new TopBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }, new BottomBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }, new LeftBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }, new RightBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }, new InsideHorizontalBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }, new InsideVerticalBorder() { Val = new EnumValue<BorderValues>(BorderValues.Birds), Size = 24 }) );
// Append the TableProperties object to the empty table. table.AppendChild<TableProperties>(tableProperties);
// Create a row and a cell. TableRow tableRow = new TableRow(); TableCell tableCell1 = new TableCell();
// Specify the width property of the table cell. tableCell1.Append(new TableCellProperties( new TableCellWidth() { Type = TableWidthUnitValues.Dxa, Width = "2400" }));
// Write some text in the cell. tableCell1.Append(new Paragraph(new Run(new Text("Some cell text."))));
// Append the cell to the row. tableRow.Append(tableCell1);
// Create a second table cell by copying the OuterXml value of the first table cell. TableCell tableCell2 = new TableCell(tableCell1.OuterXml);
// Append the cell to the row. tableRow.Append(tableCell2);
// Append the table row to the table. table.Append(tableRow);
// Append the table to the document. document.MainDocumentPart.Document.Body.Append(table);
Console.WriteLine("The table has been created.\nPress a key."); Console.ReadKey(); } } } }
```
```vb Imports DocumentFormat.OpenXml Imports DocumentFormat.OpenXml.Packaging Imports DocumentFormat.OpenXml.Wordprocessing
Module Module1 ' Insert a table into an existing word processing document. Sub Main(ByVal args As String()) Dim fileName As String = "C:\users\public\documents\TablePropertiesEx.docx" Using document As WordprocessingDocument = WordprocessingDocument.Open(fileName, True) ' Create an empty table. Dim table As New Table()
' Create a TableProperties object and specify its border information. Dim tableProperties As New TableProperties(New TableBorders(New TopBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }, New BottomBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }, New LeftBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }, New RightBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }, New InsideHorizontalBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }, New InsideVerticalBorder() With { _ .Val = New EnumValue(Of BorderValues)(BorderValues.Birds), _ .Size = 24 _ }))
' Append the TableProperties object to the empty table. table.AppendChild(Of TableProperties)(tableProperties)
' Create a row and a cell. Dim tableRow As New TableRow() Dim tableCell1 As New TableCell()
' Specify the width property of the table cell. tableCell1.Append(New TableCellProperties(New TableCellWidth() With { _ .Type = TableWidthUnitValues.Dxa, _ .Width = "2400" _ }))
' Write some text in the cell. tableCell1.Append(New Paragraph(New Run(New Text("Some cell text."))))
' Append the cell to the row. tableRow.Append(tableCell1)
' Create a second table cell by copying the OuterXml value of the first table cell. Dim tableCell2 As New TableCell(tableCell1.OuterXml)
' Append the cell to the row. tableRow.Append(tableCell2)
' Append the table row to the table. table.Append(tableRow)
' Append the table to the document. document.MainDocumentPart.Document.Body.Append(table)
Console.WriteLine("The table has been created." & vbLf & "Press a key.") Console.ReadKey() End Using End Sub End Module
```
